(17, 2, 'Principles', 5, 'Principles relating to processing of personal data', 1, 'Personal data shall be\nprocessed lawfully, fairly and in a transparent manner in relation to the data subject (‘lawfulness, fairness and transparency’)\ncollected for specified, explicit and legitimate purposes and not further processed in a manner that is incompatible with those purposes; further processing for archiving purposes in the public interest, scientific or historical research purposes or statistical purposes shall, in accordance with Article 89(1), not be considered to be incompatible with the initial purposes (‘purpose limitation’)\nadequate, relevant and limited to what is necessary in relation to the purposes for which they are processed (‘data minimisation’)\naccurate and, where necessary, kept up to date; every reasonable step must be taken to ensure that personal data that are inaccurate, having regard to the purposes for which they are processed, are erased or rectified without delay (‘accuracy’)\nkept in a form which permits identification of data subjects for no longer than is necessary for the purposes for which the personal data are processed; personal data may be stored for longer periods insofar as the personal data will be processed solely for archiving purposes in the public interest, scientific or historical research purposes or statistical purposes in accordance with Article 89(1) subject to implementation of the appropriate technical and organisational measures required by this Regulation in order to safeguard the rights and freedoms of the data subject (‘storage limitation’)\nprocessed in a manner that ensures appropriate security of the personal data, including protection against unauthorised or unlawful processing and against accidental loss, destruction or damage, using appropriate technical or organisational measures (‘integrity and confidentiality’).', 'http://gdpr-info.eu/art-5-gdpr/', '[0.20149368638032297, 0.0, 0.0, 0.0, 0.1945008075295655, 0.0,