(228, 5, 'Transfers of personal data to third countries or international organisations', 49, 'Derogations for specific situations', 1, 'In the absence of an adequacy decision pursuant to Article 45(3), or of appropriate safeguards pursuant to Article 46, including binding corporate rules, a transfer or a set of transfers of personal data to a third country or an international organisation shall take place only on one of the following conditions\nthe data subject has explicitly consented to the proposed transfer, after having been informed of the possible risks of such transfers for the data subject due to the absence of an adequacy decision and appropriate safeguards\nthe transfer is necessary for the performance of a contract between the data subject and the controller or the implementation of pre-contractual measures taken at the data subject’s request\nthe transfer is necessary for the conclusion or performance of a contract concluded in the interest of the data subject between the controller and another natural or legal person\nthe transfer is necessary for important reasons of public interest\nthe transfer is necessary for the establishment, exercise or defence of legal claims\nthe transfer is necessary in order to protect the vital interests of the data subject or of other persons, where the data subject is physically or legally incapable of giving consent\nthe transfer is made from a register which according to Union or Member State law is intended to provide information to the public and which is open to consultation either by the public in general or by any person who can demonstrate a legitimate interest, but only to the extent that the conditions laid down by Union or Member State law for consultation are fulfilled in the particular case.', 'http://gdpr-info.eu/art-49-gdpr/', '[0.0, 0.4133492314479384, 0.31226573646200045, 0.0, 0.0, 0.334105663479166, 0.5990018122318569, 0.0, 0.0, 0.1599910960927275, 0.2903410126111872, 0.0, 0.0, 0.008581118303101081, 0.4